#!/usr/bin/env python3

dna = ''

# Count number of T and A
AT_count = dna.count('T')+dna.count('A')

# Print the A and T bp count
print("AT count is",AT_count)

# Count number of G and C
GC_count = dna.count('G')+dna.count('C')

# Print the G and C bp count
print("GC count is",GC_count)


# Select 100-200 substring of dna
sub_dna = dna[100:200]

# Count number of G in sub_dna
sub_dna.count('G')

# Print the number of G in sub_dna
print("Number of G in substring is",sub_dna.count('G'))



